import logo from './logo.svg';
import './App.css';

let name = "Abubakar";
function App() {
	return (
		<>
			<nav>
				<li>Home</li>
				<li>About</li>
				<li>Contact</li>
			</nav>
			<div className="container">
				<h1>hello , {name}</h1>
				<p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Totam, mollitia itaque rem repellendus obcaecati voluptatum aut delectus nihil, eum reiciendis consequuntur natus exercitationem dolorum, commodi consectetur. Nihil unde assumenda deleniti.</p>
			</div>
		</>
	);
}

export default App;
